      <p className="text-lg text-gray-700">
        This is a test to check if Tailwind CSS is working in your React project.
      </p>
      <button className="mt-4 px-6 py-2 bg-green-500 text-white rounded-lg hover:bg-green-600">
        Click Me
      </button>
    </div>
  );
}

export default App;
